import React from "react";



export default function TeacherLayout({children}) {
    return (

        <div className="t-page col-12">

            <header className="t-header col-12" style={{ backgroundColor: 'hotpink', height: '50px' }}>

            </header>

            <section className="mid row">
                <navbar className="t-nav col-2" style={{ backgroundColor: 'green' }}>
                    <button className="btn btn-block m-2">DASHBOARD</button>
                    <button className="btn btn-block m-2">PROFILE</button>
                    <button className="btn btn-block m-2">ADD PROFILE</button>

                </navbar>

                <div className="t-content col-10" style={{ backgroundColor: 'yellow' }}>{children}

                </div>

            </section>

            <footer className="t-footer col-12" style={{ backgroundColor: 'orange' }}>

            </footer>

        </div>

    );
}
